let all_a=document.querySelectorAll("a");all_a.forEach(((e,t)=>{all_a[t].onclick=e=>{if("_blank"!==all_a[t].getAttribute("target")){e.preventDefault();let l=all_a[t].getAttribute("href");history.replaceState(null,"/",(location.href.slice(-1),l)),fetch(l).then((e=>e.text())).then((e=>{let t=(new DOMParser).parseFromString(e,"text/html");document.querySelector("html").innerHTML=t.querySelector("html").innerHTML}))}}}));
